import React from "react";

const NavButtons = ({ goToPrevPage, goToNextPage, isDisabled }) => {
    return (
        <div>
            <button id="back" type="button" onClick={goToPrevPage} disabled={isDisabled}>BACK</button>
            <button id="nextBtn" type="button" onClick={goToNextPage}>NEXT</button>
        </div>
    );
}

export default NavButtons;
